import logo from './logo.svg';
import './App.css';
import Shop from './views/Shop';
import Footer from './views/Footer';
import Homepage from './views/Homepage';
import Navbar from './views/Navbar';

function App() {
  return (
    <>
    <Homepage/>
    <Navbar/>
    <Shop/>
    <Footer/>
    </>
  );
}

export default App;
